	getUpdates: () => {
		const updatedArray = fetchStandup.data.map((row) => {
			return {
				...row,
					"Created At": row.date
			};
		});
		return updatedArray.filter((row) => { 
			if (Input1.text) {
				return row.name.toLowerCase().includes(Input1.text.toLowerCase())
			} else if (Select1.selectedOptionValue) {
				return row.pod == Select1.selectedOptionValue
			} else {
				return true;
			}
		})
	}
}

